import React, { Component } from 'react';
import "./home.css";

class Home extends Component{
    render(){
        return(
            <div className="HomePage">
                <h1>
                    Welcome to the home page
                </h1>
                <p>{this.props.gretting}</p>
            </div>
        )
    }
}

export default Home;
